				["events"] = "ITEM_PUSH,PLAYER_EQUIPMENT_CHANGED,PLAYER_ENTERING_WORLD",
				["custom"] = "function(allstates,event,...)\n    \n    local function MouseoverTooltip(region, owner, id)\n        GameTooltip:SetOwner(owner, \"ANCHOR_NONE\");\n        GameTooltip:SetPoint(\"BOTTOM\", owner, \"TOP\");\n        GameTooltip:ClearLines();\n        GameTooltip:SetItemByID(id);\n        GameTooltip:Show();\n    end                \n    \n    local numLegs = 0\n    if type(allstates) ~= \"table\" then return end         \n    \n    for index=1,17,1 do\n        local itemID=GetInventoryItemID(\"player\",index)\n        if itemID then\n            local itemName,itemLink,itemQuality,iLevel,_,_,_,_,_,itemTexture=GetItemInfo(itemID)\n            if itemName then                \n                local state = {}\n                allstates[numLegs + 1] = state\n                if itemQuality == 5 then -- Legendary            \n                    state.show = true\n                    state.changed = true\n                    state.name = itemName\n                    state.itemID = itemID\n                    state.resort = true\n                    state.icon = itemTexture    \n                    state.fullString = \"\"\n                    state.r = 0\n                    state.g = 1\n                    numLegs = numLegs + 1            \n                    \n                    local region = WeakAuras.GetRegion(aura_env.id, numLegs)\n                    if aura_env.ShowInBags or aura_env.ShowBorder then\n                        aura_env.SetBorderAndSize(region, true)\n                        local border=region:CreateTexture(nil,\"BACKGROUND\")\n                        border:SetTexture(\"Interface\\\\ChatFrame\\\\ChatFrameBackground\")\n                        border:SetPoint(\"TOPLEFT\",-1*aura_env.BorderLineWidth,aura_env.BorderLineWidth+1)\n                        border:SetPoint(\"BOTTOMRIGHT\",aura_env.BorderLineWidth,-1*aura_env.BorderLineWidth)\n                        border:SetVertexColor(0,1,0,.75) \n                    end\n                    \n                    region:EnableMouse(true)\n                    region:SetScript(\"OnEnter\", \n                        function() \n                            MouseoverTooltip(region,region,itemID);\n                    end);\n                    region:SetScript(\"OnLeave\", WeakAuras.HideTooltip);\n                end\n            end\n        end        \n    end    \n    \n    if aura_env.ShowInBags then \n        local index = 17\n        for bagIndex=0,4,1 do\n            numBagSlots = GetContainerNumSlots(bagIndex)        \n            for slotIndex=1,numBagSlots,1 do\n                index = index + 1         \n                local texture,_,_,_,_,_,_,_,_,itemID = GetContainerItemInfo(bagIndex, slotIndex)\n                if itemID then\n                    local itemName,itemLink,itemQuality,iLevel,_,_,_,_,_,itemTexture=GetItemInfo(itemID)\n                    \n                    local state = {}\n                    allstates[numLegs + 1] = state\n                    if itemQuality == 5 then -- Legendary\n                        state.show = true\n                        state.changed = true\n                        state.name = itemName\n                        state.itemID = itemID\n                        state.resort = true\n                        state.icon = itemTexture    \n                        state.r = 1\n                        state.g = 0\n                        numLegs = numLegs + 1      \n                        \n                        local region = WeakAuras.GetRegion(aura_env.id, numLegs)\n                        aura_env.SetBorderAndSize(region, false)\n                        \n                        \n                        region:EnableMouse(false)\n                        region:SetScript(\"OnEnter\", \n                            function() \n                                MouseoverTooltip(region,region,itemID);\n                        end);\n                        region:SetScript(\"OnLeave\", WeakAuras.HideTooltip);\n                        \n                    end        \n                end \n            end   \n        end\n    end    \n    \n    if numLegs == 0 then        \n        for key,state in pairs(allstates) do        \n            state.show = false\n            state.changed = true\n        end  \n    end\n    \n    return true\nend",
